import React from "react";
import "./HowToDoDetails.css";
function HowToDoDetails() {
  return (
    <div>
      <h1 style={{ textAlign: "center", fontFamily: "sans-serif" }}>
        <b>
          <big>How-To</big>
        </b>
      </h1>
    </div>
  );
}

export default HowToDoDetails;
